function dispatcher(module, args)

	if module == 'glitch' then
		glitchTools(args.path)
	else
		-- do nothing
	end

end

function glitchTools(path)
	dprint('glitchTools. Path = '..path)

	-- Get a list of Glitch Tools
	local files = listFiles(path, '.setting')
	table.sort(files)
	local rows = math.ceil(table.getn(files) / MAX_COLUMNS)


	local x = 0
	local y = 0
	local width = 500
	local height = 120 + 35 * rows
	glitchWin = createMainWindow(x, y, width, height, 'Glitch Tools', 'glitch', '<a href="http://wiki/doku.php?id=mee_glitch_tools">Documentation</a>')

	content = glitchWin:GetItems().root:GetItems().content

	-- Generate HTML for logo header
	html = "<html>\n"
	html = html.."\t<head>\n"
	html = html.."\t\t<style>\n"
	html = html.."\t\t</style>\n"
	html = html .."\t</head>\n"
	html = html .."\t<body>\n"
	html = html .."\t<div>\n"
	html = html .."\t<div style=\"float:right;\">\n"
	html = html .. glitchToolsLogo()
	html = html .. "\t</div>\n"
	html = html .. "\t</body>\n"
	html = html .. "</html>"

	glitchWin:GetItems().museLogo.HTML = html
	glitchWin:GetItems().museLogo.MinimumSize = {259, 115}
	glitchWin:GetItems().museLogo.MaximumSize = {width * 2, 115}
	glitchWin:GetItems().museLogo.Alignment = { AlignHCenter = true, AlignTop = true, }
	glitchWin:Resize({ width, height })

	-- add rows
	for i=1, rows do 
		content:AddChild(ui:HGroup{ ID = 'row'..i, Weight = 0, })
	end

	-- Add buttons
	local glitchButtons = {}
	for i, file in ipairs(files) do
		local parent = 'row'..math.ceil(i/(table.getn(files)/rows))
		local text = string.gsub(file, 'MT_', '')
		local text = string.gsub(text, 'Glitch_', '')
		local text = string.gsub(text, '.setting', '')
		addGlitchButton(parent, file, text)
	end

	-- Create Dynamic Event Handlers
	local dynamicFunctions = {}
	for i, file in ipairs(files) do 
		dynamicFunctions[file] = {}
		dynamicFunctions[file].Clicked = function (ev)
			_comp:DoAction("AddSetting", { filename = path..file })
		end
	end
		 

	for i, func in pairs(dynamicFunctions) do glitchWin.On[i] = func end

	-- close events
	function glitchWin.On.glitch.Close(ev) 
		glitchWin:Hide()
		status = "Window closed by user."
	end

	glitchWin:Show()

end

function addGlitchButton(parent, ID, name)
	if not name then
		name = ID
	end

	local content = glitchWin:GetItems().root:GetItems()[parent]
	content:AddChild(ui:Button{ ID = ID, Weight = 1, Text = name, })
end

function addUIButton(parent, ID, name)
--	dprint(parent..", "..ID..", "..name)
	if not name then
		name = ID
	end

	local content = window:GetItems().root:GetItems()[parent]
	content:AddChild(ui:Button{ ID = ID, Weight = 1, Text = name, })
end



